Third Man Books is excited to announce that the 2023 Heartland Fall Forum opening event will be hosted at the Third Man Records Detroit storefront. Keynote speaker Jack White will be featured in discussion with writer Hanif Abdurraqib and Third Man Records co-founder Ben Blackwell about White's forthcoming book THE WHITE STRIPES COMPLETE LYRICS. Also performing will be Adrian Matejka and Caroline Randall Williams, both poets published by Third Man Books. More info at the link in bio. 

"The Heartland Fall Forum is the premiere gathering place for those interested in doing business with independent bookstores throughout the Midwest. Hosted jointly by the Great Lakes Independent Booksellers Association and the Midwest Independent Booksellers Association." 


